import NavBar from './NavBar';
import Footer from './Footer';
import '../styles/Leena.css';
import backgroundImg from '../assets/leena/SplashScreen/TT_splash_v02_chibi_20220207.png';

function Leena() {
    return (
        <div>
            <NavBar style="light"/>
            <div className="leena-bg" style={{ backgroundImage: `url(${backgroundImg})` }}>
            </div>
            <p>Become the mayor and build your town</p>
            <p>Kick up your own gang and run your family's crime activities. Choose which mobsters and gangsters should be devoted to your Cosa Nostra and lead them against the fierce competition of the Mafia Town.</p>
            <p>Leena returns home and becomes mayor</p>
            <p>Help her to transform the sleepy countryside village into flourishing modern family town!</p>
            <p>Uncover the twists of her family story</p>
            <p>Help them to rebuild and modernize their homes and businesses. Clean up the mess, grow and decorate the Town.</p>
            <p>Make Leena's Place the dream town</p>
            <p>Create a flourishing family town</p>
            <p>Help your citizens build lovely businesses</p>
            <p>Live into the breath-taking story with many characters</p>
            <p>Build a modern family  town to live in!</p>
            <p>Craft and trade useful goods  with other characters</p>
            <p>Customize your town with beautiful decorations</p>
            <Footer />
        </div>
    );
}

export default Leena;
